import React, { useState, useEffect } from 'react';
import {
    Grid,
    Paper,
    Typography,
    List,
    ListItem,
    ListItemText,
    ListItemAvatar,
    Avatar,
    Box,
    Button,
    Dialog,
    DialogActions,
    DialogContent,
    DialogTitle,
    TextField,
    Drawer,
    AppBar,
    Toolbar,
    IconButton,
    Divider,
    ListItemIcon,
} from '@mui/material';
import {
    People,
    Group,
    Event,
    AttachMoney,
    Menu,
    SportsCricket,
    ChevronLeft,
    ChevronRight // Import the correct icon name
} from '@mui/icons-material';
import { styled, useTheme } from '@mui/material/styles'; // Import styled and useTheme
import PageLayout from '../components/PageLayout';
import api from '../utils/api';
import AdminList from '../components/AdminList';
import { Link, useNavigate } from 'react-router-dom';
import Cookies from 'js-cookie';

const drawerWidth = 240;

const Main = styled('main', { shouldForwardProp: (prop) => prop !== 'open' })(
    ({ theme, open }) => ({
        flexGrow: 1,
        padding: theme.spacing(3),
        transition: theme.transitions.create('margin', {
            easing: theme.transitions.easing.sharp,
            duration: theme.transitions.duration.leavingScreen,
        }),
        marginLeft: `-${drawerWidth}px`,
        ...(open && {
            transition: theme.transitions.create('margin', {
                easing: theme.transitions.easing.easeOut,
                duration: theme.transitions.duration.enteringScreen,
            }),
            marginLeft: 0,
        }),
    })
);

const AppBarStyled = styled(AppBar, {
    shouldForwardProp: (prop) => prop !== 'open',
})(({ theme, open }) => ({
    transition: theme.transitions.create(['margin', 'width'], {
        easing: theme.transitions.easing.sharp,
        duration: theme.transitions.duration.leavingScreen,
    }),
    ...(open && {
        width: `calc(100% - ${drawerWidth}px)`,
        marginLeft: `${drawerWidth}px`,
        transition: theme.transitions.create(['margin', 'width'], {
            easing: theme.transitions.easing.easeOut,
            duration: theme.transitions.duration.enteringScreen,
        }),
    }),
}));

const DrawerHeader = styled('div')(({ theme }) => ({
    display: 'flex',
    alignItems: 'center',
    padding: theme.spacing(0, 1),
    // necessary for content to be below app bar
    ...theme.mixins.toolbar,
    justifyContent: 'flex-end',
}));

const AdminDashboard = () => {
    const [addAdminDialogOpen, setAddAdminDialogOpen] = useState(false);
    const [newAdminData, setNewAdminData] = useState({ name: '', email: '', password: '' });
    const [error, setError] = useState('');
    const [successMessage, setSuccessMessage] = useState('');
    const [adminCount, setAdminCount] = useState(0);
    const [playerCount, setPlayerCount] = useState(0);
    const [open, setOpen] = useState(false);
    const navigate = useNavigate();
    const theme = useTheme();

    useEffect(() => {
        const fetchAdminCount = async () => {
            try {
                const response = await api.get('/admin/count');
                setAdminCount(response.data.count);
            } catch (error) {
                console.error('Error fetching admin count:', error);
                setError('Failed to load admin count.');
            }
        };
        const fetchPlayerCount = async () => {
            try {
                const response = await api.get('/players/count');
                setPlayerCount(response.data.count);
            } catch (error) {
                console.error('Error fetching player count:', error);
                setError('Failed to load player count.');
            }
        };
        fetchAdminCount();
        fetchPlayerCount();
    }, []);

    const handleAddAdminDialogOpen = () => {
        setAddAdminDialogOpen(true);
    };

    const handleAddAdminDialogClose = () => {
        setAddAdminDialogOpen(false);
        setNewAdminData({ name: '', email: '', password: '' });
        setError('');
        setSuccessMessage('');
    };

    const handleNewAdminDataChange = (e) => {
        setNewAdminData({ ...newAdminData, [e.target.name]: e.target.value });
    };

    const handleCreateNewAdmin = async () => {
        try {
            const response = await api.post('/admin/register', newAdminData);
            if (response.status === 201) {
                setSuccessMessage('Admin added successfully!');
                setAddAdminDialogOpen(false);
                setNewAdminData({ name: '', email: '', password: '' });
            } else {
                setError(response.data.message || 'Failed to add admin');
            }
        } catch (error) {
            console.error('Error creating admin:', error);
            setError(error.response?.data?.message || 'Failed to add admin');
        }
    };

    const handleDrawerOpen = () => {
        setOpen(true);
    };

    const handleDrawerClose = () => {
        setOpen(false);
    };
    const handleLogout = () => {
        Cookies.remove('token');
        Cookies.remove('admin');
        navigate('/');
    };

    return (
        <Box sx={{ display: 'flex' }}>
            <AppBarStyled position="fixed" open={open}>
                <Toolbar>
                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="open drawer"
                        onClick={handleDrawerOpen}
                        sx={{ mr: 2, ...(open && { display: 'none' }) }}
                    >
                        <Menu />
                    </IconButton>
                    <Typography variant="h6" noWrap component="div">
                        Admin Cricket Auction
                    </Typography>
                    <Button color="inherit" onClick={handleLogout}>
                        Logout
                    </Button>
                </Toolbar>
            </AppBarStyled>
            <Drawer
                sx={{
                    width: drawerWidth,
                    flexShrink: 0,
                    '& .MuiDrawer-paper': {
                        width: drawerWidth,
                        boxSizing: 'border-box',
                    },
                }}
                variant="persistent"
                anchor="left"
                open={open}
            >
                <DrawerHeader>
                    <IconButton onClick={handleDrawerClose}>
                        {theme.direction === 'ltr' ? <ChevronLeft /> : <ChevronRight />}
                    </IconButton>
                </DrawerHeader>
                <Divider />
                <List>
                    <ListItem button component={Link} to="/dashboard">
                        <ListItemIcon>
                            <People />
                        </ListItemIcon>
                        <ListItemText primary="Dashboard" />
                    </ListItem>
                    <ListItem button component={Link} to="/players">
                        <ListItemIcon>
                            <SportsCricket />
                        </ListItemIcon>
                        <ListItemText primary="Players" />
                    </ListItem>
                    <ListItem button component={Link} to="/auctions">
                        <ListItemIcon>
                            <Event />
                        </ListItemIcon>
                        <ListItemText primary="Auctions" />
                    </ListItem>
                </List>
            </Drawer>
            <Main open={open}>
                <DrawerHeader />
                <Grid container spacing={3}>
                    <Grid item xs={12} sm={6} md={3}>
                        <Paper elevation={3} sx={{ p: 2, display: 'flex', alignItems: 'center' }}>
                            <Avatar sx={{ bgcolor: 'info.main', mr: 2 }}>
                                <People />
                            </Avatar>
                            <div>
                                <Typography variant="h6">Total Admins</Typography>
                                <Typography variant="subtitle1">{adminCount}</Typography>
                            </div>
                        </Paper>
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <Paper elevation={3} sx={{ p: 2, display: 'flex', alignItems: 'center' }}>
                            <Avatar sx={{ bgcolor: 'primary.main', mr: 2 }}>
                                <People />
                            </Avatar>
                            <div>
                                <Typography variant="h6">Total Players</Typography>
                                <Typography variant="subtitle1">{playerCount}</Typography>
                            </div>
                        </Paper>
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <Paper elevation={3} sx={{ p: 2, display: 'flex', alignItems: 'center' }}>
                            <Avatar sx={{ bgcolor: 'success.main', mr: 2 }}>
                                <Group />
                            </Avatar>
                            <div>
                                <Typography variant="h6">Total Teams</Typography>
                                <Typography variant="subtitle1">8</Typography>
                            </div>
                        </Paper>
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <Paper elevation={3} sx={{ p: 2, display: 'flex', alignItems: 'center' }}>
                            <Avatar sx={{ bgcolor: 'secondary.main', mr: 2 }}>
                                <Event />
                            </Avatar>
                            <div>
                                <Typography variant="h6">Active Auctions</Typography>
                                <Typography variant="subtitle1">1</Typography>
                            </div>
                        </Paper>
                    </Grid>
                    <Grid item xs={12}>
                        <AdminList />
                    </Grid>
                    <Grid item xs={12}>
                        <Button variant="contained" color="primary" onClick={handleAddAdminDialogOpen}>
                            Add New Admin
                        </Button>
                    </Grid>
                    <Dialog open={addAdminDialogOpen} onClose={handleAddAdminDialogClose}>
                        <DialogTitle>Add New Admin</DialogTitle>
                        <DialogContent>
                            {error && <Typography color="error">{error}</Typography>}
                            {successMessage && <Typography color="success">{successMessage}</Typography>}
                            <TextField
                                autoFocus
                                margin="dense"
                                name="name"
                                label="Name"
                                type="text"
                                fullWidth
                                variant="standard"
                                value={newAdminData.name}
                                onChange={handleNewAdminDataChange}
                            />
                            <TextField
                                margin="dense"
                                name="email"
                                label="Email Address"
                                type="email"
                                fullWidth
                                variant="standard"
                                value={newAdminData.email}
                                onChange={handleNewAdminDataChange}
                            />
                            <TextField
                                margin="dense"
                                name="password"
                                label="Password"
                                type="password"
                                fullWidth
                                variant="standard"
                                value={newAdminData.password}
                                onChange={handleNewAdminDataChange}
                            />
                        </DialogContent>
                        <DialogActions>
                            <Button onClick={handleAddAdminDialogClose}>Cancel</Button>
                            <Button onClick={handleCreateNewAdmin}>Create</Button>
                        </DialogActions>
                    </Dialog>
                </Grid>
            </Main>
        </Box>
    );
};

export default AdminDashboard;
